import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import Driver from "../agents/Driver";
import Passenger from "../agents/Passenger";

function Screen(props) {
  // const numDrivers = 4;
  // const [drivers, setDrivers] = useState([]);
  const drivers = [
    new Driver(50),
    new Driver(60),
    new Driver(40),
    new Driver(10),
  ];
  console.log(drivers[0], "heee");
  const passengers = [
    new Passenger(50, 60),
    new Passenger(20, 40),
    new Passenger(70, 50),
  ];

  return (
    <div>
      {drivers.map((driver) => (
        <div key={driver.id}>
          <p>Driver state: {driver.state}</p>
          <p>Driver location: {driver.location}</p>
        </div>
      ))}
      {/* <div> {passengers}</div> */}
    </div>
  );
}
export default Screen;
